import React from 'react';

const SkinHairCare = () => {
  const skinCareRecipes = [
    {
      name: 'Turmeric Face Pack',
      ingredients: ['2 tbsp gram flour (besan)', '1/2 tsp turmeric powder', '2-3 drops rose water', 'Milk/yogurt as needed'],
      method: 'Mix all ingredients to form a paste. Apply evenly on face and neck. Leave for 15-20 minutes and rinse with lukewarm water.',
      benefits: 'Anti-inflammatory, brightening, and acne-fighting properties',
    },
    {
      name: 'Kumkumadi Face Oil',
      ingredients: ['Saffron', 'Sandalwood powder', 'Rose petals', 'Sesame oil base'],
      method: 'Traditional preparation involves infusing ingredients in base oil under sunlight for specific duration.',
      benefits: 'Brightens complexion, reduces pigmentation, and promotes skin radiance',
    },
  ];

  const hairCareRecipes = [
    {
      name: 'Kerala Hair Oil Massage',
      ingredients: ['Coconut oil', 'Curry leaves', 'Fenugreek seeds', 'Amla powder'],
      method: 'Heat coconut oil with ingredients, strain, and cool. Massage into scalp and leave overnight.',
      benefits: 'Promotes hair growth, prevents premature graying, strengthens roots',
    },
    {
      name: 'Hibiscus Hair Mask',
      ingredients: ['Hibiscus flowers/leaves', 'Yogurt', 'Aloe vera gel', 'Coconut oil'],
      method: 'Blend ingredients into a smooth paste. Apply from roots to tips, leave for 30 minutes, then wash.',
      benefits: 'Prevents hair fall, adds shine, promotes growth',
    },
  ];

  const harmfulIngredients = [
    {
      name: 'Parabens',
      found: 'Shampoos, conditioners, lotions',
      why: 'Hormone disruption, potential link to breast cancer',
      natural_alternative: 'Tea tree oil, grapefruit seed extract',
    },
    {
      name: 'Sulfates (SLS/SLES)',
      found: 'Shampoos, body wash, face cleansers',
      why: 'Strips natural oils, irritates skin/scalp',
      natural_alternative: 'Shikakai, soap nut (reetha)',
    },
    {
      name: 'Phthalates',
      found: 'Fragranced products, nail polish',
      why: 'Endocrine disruption, developmental issues',
      natural_alternative: 'Essential oils, natural fragrances',
    },
  ];

  return (
    <div className="container mx-auto px-4 py-8"
      style={{
        backgroundImage: 'url("/images/home-bg.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundAttachment: 'fixed'
      }}>
      <h1 className="text-3xl font-bold text-purple-800 mb-8">Skin & Hair Care</h1>

      {/* Natural Remedies Section */}
      <section className="mb-12">
        <h2 className="text-2xl font-semibold text-purple-700 mb-6">Kerala Ayurveda Natural Remedies</h2>

        {/* Skin Care Recipes */}
        <div className="mb-8">
          <h3 className="text-xl font-semibold text-purple-600 mb-4">Skin Care Recipes</h3>
          <div className="grid md:grid-cols-2 gap-6">
            {skinCareRecipes.map((recipe, index) => (
              <div key={index} className="bg-white p-6 rounded-lg shadow-md">
                <h4 className="font-semibold mb-3">{recipe.name}</h4>
                <div className="space-y-3">
                  <div>
                    <p className="font-medium text-sm text-purple-600">Ingredients:</p>
                    <ul className="list-disc list-inside text-gray-600">
                      {recipe.ingredients.map((ingredient, i) => (
                        <li key={i}>{ingredient}</li>
                      ))}
                    </ul>
                  </div>
                  <div>
                    <p className="font-medium text-sm text-purple-600">Method:</p>
                    <p className="text-gray-600">{recipe.method}</p>
                  </div>
                  <div>
                    <p className="font-medium text-sm text-purple-600">Benefits:</p>
                    <p className="text-gray-600">{recipe.benefits}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Hair Care Recipes */}
        <div>
          <h3 className="text-xl font-semibold text-purple-600 mb-4">Hair Care Recipes</h3>
          <div className="grid md:grid-cols-2 gap-6">
            {hairCareRecipes.map((recipe, index) => (
              <div key={index} className="bg-white p-6 rounded-lg shadow-md">
                <h4 className="font-semibold mb-3">{recipe.name}</h4>
                <div className="space-y-3">
                  <div>
                    <p className="font-medium text-sm text-purple-600">Ingredients:</p>
                    <ul className="list-disc list-inside text-gray-600">
                      {recipe.ingredients.map((ingredient, i) => (
                        <li key={i}>{ingredient}</li>
                      ))}
                    </ul>
                  </div>
                  <div>
                    <p className="font-medium text-sm text-purple-600">Method:</p>
                    <p className="text-gray-600">{recipe.method}</p>
                  </div>
                  <div>
                    <p className="font-medium text-sm text-purple-600">Benefits:</p>
                    <p className="text-gray-600">{recipe.benefits}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>



    </div>
  );
};

export default SkinHairCare;
